import React from "react";

function Tile(props) {
  const myClass = props.active ? "blinkDivUp" : " ";
  return (
    <div
      className="tile + `${myClass}`"
      style={{
        backgroundColor: props.data.bkgd
      }}
    >
      <div className="title">{props.data.title}</div>
      <div className="number">{props.data.number}</div>
    </div>
  );
}

export default Tile;
